import styles from "/styles.module.css"

function App() {
    return (
        <>
            <img src="https://cdn.pixabay.com/photo/2016/08/23/10/48/dart-board-1614051_1280.png" height="350px"/>
            <div className={styles.line}></div>
        </>
    )
}

export default App;
